export default {
    goods: [
        {
            id: 1,
            title: 'potato',
            quantity: 1,
            isOver: false
        }
    ],
    create(){
        this.goods.push({
            title: '',
            quantity: 0,
            isOver: false
        })
    },
    deleteTodo(goodItem){
        this.goods.remove(goodItem)
    }
}
